import React from 'react';

class Help extends React.Component{
  render() {
    return (
      <div>
        <a href="#">Change or cancel a trip </a>
        <a href="#">Use a credit or a copun </a>
        <a href="#">Track your refunds </a>
      </div>
    );
  }
}
export default Help
